<!DOCTYPE html>
<html lang='en'>
<head>
<meta charset='UTF-8'>
<title>Yay!</title>
<style>
  body {
    background: linear-gradient(135deg, #ffe6e6, #fff0f0);
    margin: 0;
    height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    overflow: hidden;
    position: relative;
    font-family: Arial, sans-serif;
  }
  /* Heart wrapper and shape behind the message and GIF */
  .heart-wrapper {
    position: relative;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    margin-bottom: 40px;
  }
  .heart-shape {
    position: absolute;
    /* Make the white heart 10% smaller than before */
    width: 540px;
    height: 540px;
    background: #ffffff;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%) rotate(-45deg);
    transform-origin: center;
    z-index: -1;
    /* Add a subtle shadow so the white heart is visible against the light pink background */
    box-shadow: 0 0 20px rgba(0,0,0,0.1);
  }
  .heart-shape::before,
  .heart-shape::after {
    content: "";
    position: absolute;
    width: 540px;
    height: 540px;
    background: #ffffff;
    border-radius: 50%;
  }
  .heart-shape::before {
    top: -270px;
    left: 0;
  }
  .heart-shape::after {
    left: 270px;
    top: 0;
  }
  .message-container {
    text-align: center;
    z-index: 1;
  }
  h1 {
    color: #d6336c;
    font-size: 36px;
    margin: 0;
  }
  h2 {
    color: #d6336c;
    font-size: 48px;
    margin: 10px 0 20px 0;
  }
  /* Style for the Bible verse added under the celebration heading */
  .bible-verse {
    color: #6a0dad; /* purple tone symbolizing spirituality and royalty */
    font-size: 20px;
    line-height: 1.4;
    max-width: 80%;
    margin: 10px auto 0 auto;
    text-align: center;
    font-style: italic;
  }
  .gif {
    width: 300px;
    height: auto;
    border-radius: 10px;
    box-shadow: 0 4px 6px rgba(0,0,0,0.2);
  }
  .confetti {
    position: fixed;
    top: -10px;
    width: 8px;
    height: 8px;
    opacity: 0.9;
    border-radius: 50%;
    animation-name: fall;
    animation-timing-function: linear;
    animation-iteration-count: infinite;
  }
  @keyframes fall {
    to {
      transform: translateY(100vh) rotate(360deg);
    }
  }
</style>
</head>
<body>

<div class='heart-wrapper'>
  <!-- Heart shape behind the content -->
  <div class='heart-shape'></div>
  <div class='message-container'>

<script>
function createConfetti() {
  const colors = ['#ff6fa1','#ffd700','#a1e3a1','#77ddff','#ffb347'];
  for (let i = 0; i < 80; i++) {
    const conf = document.createElement('div');
    conf.classList.add('confetti');
    conf.style.left = Math.random() * window.innerWidth + 'px';
    conf.style.backgroundColor = colors[Math.floor(Math.random() * colors.length)];
    conf.style.animationDuration = (5 + Math.random() * 5) + 's';
    conf.style.animationDelay = (Math.random() * 5) + 's';
    document.body.appendChild(conf);
  }
}
window.onload = createConfetti;
</script>
